import React, { Component } from 'react';
import './App.css';

class App extends Component {

	constructor(){
		super();
		this.state = {
			someState: null,
		}
	}

	componentDidMount(){
		fetch('/somenonsense')
		.then(res => {
			return res.json();
		})
		.then(json => {
                console.log(json);

		})
	}

	render() {
		return (
			<div>
				{JSON.stringify(this.state.someState)}
			</div>
		);
	}
}

export default App;
